import { makeStyles } from '@material-ui/core'
import { red } from '@material-ui/core/colors'

const useStyles = makeStyles({
    appBar : {
        height : 50,
        background : 'red'
    }, 
    search : {
        marginTop : 50,
        width : '80%',
        borderRadius : '50',
        height : 30
    }
})

export default useStyles
